import s from "../HeaderCenter/HeaderCenter.module.css";

const HeaderCenter = () => {

    return (
        <div className={s.header_center}>
            <div className={s.header_center_container}>
                <div className={s.header_center_container_logo}>
                    <img className={s.header_center_container_logo_img}
                         src="https://pizzatime.com.ua/wp-content/uploads/2020/11/PT-Logo_round_150.png.pagespeed.ce.JMaxdt0csO.png"
                         alt=""/>
                </div>
                <div className={s.header_center_container_menu}>
                    <span>Меню</span>
                </div>
                <div className={s.header_center_container_sell}>

                </div>
            </div>

        </div>
    )

}

export default HeaderCenter;
